import React, { Component } from "react";
import './App.css';
import Searchbar from './components/Searchbar';
import 'bootstrap/dist/css/bootstrap.css';
import { Nav, Navbar } from 'react-bootstrap';

class App extends Component {

  constructor(props) {
    super(props);
    this.state = { serverResponse: "" };
  }

  callAPI() {
    fetch("http://localhost:9000/")
      .then(res => res.text())
      .then(res => this.setState({ serverResponse: res }));
  }

  componentWillMount() {
    this.callAPI();
  }

  render() {
    return (
      <div> 
        <Navbar class="navbar">
          <Navbar.Brand class="logo">
            <img src={process.env.PUBLIC_URL+"logo.png"} alt="" class="logoImage"/>
            Three-A-Mangos
          </Navbar.Brand>
          <Nav>
            <Nav.Link color="#FFF">Search</Nav.Link>
          </Nav>
        </Navbar>
      </div>
    )
  }
}

export default App;
